import json
import uuid
from datetime import datetime

class DataEntry:
    def __init__(self, duns, office_code, amount, date):
        self.id = str(uuid.uuid4())
        self.duns = duns
        self.office_code = office_code
        self.amount = amount
        self.date = date
        self.status = "Pending"
        self.errors = []

    def validate(self):
        if not self.duns or len(self.duns) != 9:
            self.errors.append("Invalid DUNS number.")
        if not self.office_code or not isinstance(self.office_code, str):
            self.errors.append("Office code is required.")
        if self.amount <= 0:
            self.errors.append("Amount must be greater than zero.")
        if not self.date:
            self.errors.append("Date is required.")
        return len(self.errors) == 0

class ValidationRules:
    def __init__(self):
        self.rules = {
            "duns_length": 9,
            "amount_min": 0,
        }

    def update_rule(self, rule_name, value):
        self.rules[rule_name] = value

